def solve(s):
    res = ""
    count = 0
    for c in s:
        if c == "(":
            count += 1
        elif c == ")":
            count -= 1
        elif count == 0:
            res += c
    return res

def solve(string):
    result = ""
    open_count = 0

    for char in string:
        if char == "(":
            open_count += 1
        elif char == ")":
            open_count -= 1
        elif open_count == 0:
            result += char

    return result

def solve(string):
    result = ""
    inside_parenthesis = False

    for char in string:
        if char == '(':
            inside_parenthesis = True
        elif char == ')':
            inside_parenthesis = False
        elif not inside_parenthesis:
            result += char

    return result

